(()=>{for(var e=document.getElementsByClassName("delete_btn"),t=0;t<e.length;t++)e[t].onclick=function(e){var t=e.target.id,r=document.querySelector("#delete_route".concat(t)).value;axios.delete(r).then((function(e){200==e.status&&document.querySelector(".user_skill"+t).remove()})).catch((function(e){var t=e.response;if(422==t.status||500==t.status){var r=t.data.error,n=document.querySelector(".err_msg");n.textContent=r,n.style.display=""}}))}})();
